Crime 101 - AKA &quot;Scarfies&quot;, 1999 New Zealand, 94 Minutes 

Five Otago, New Zealand University students ('Scarfies') decide to squat in an empty house. They discover a locked room that holds a hidden treasure - a large quantity of marijuana. What happens when the cash-strapped students decide to become amateur druglords for the week? And what exactly should they do about the owner of the crop? 

